import React from 'react';
import {Box, Button, Center, Flex, Input, Stack} from "@chakra-ui/react";

const Home = () => {
    return (
        <Box bg={'#F7FAFC'} minHeight={'100vh'}>

            <Flex alignItems={'center'}>
                <Stack bg={'white'} direction={'row'} minH={'200px'} maxW={'400px'} >
                    <Input placeholder={'Enter a join code'}/>
                    <Button>Join</Button>
                </Stack>
            </Flex>

        </Box>
    );
};

export default Home;
